" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 543px\">",
"   <div class=\"ttl\">",
"    Parasternal short axis view of aortic valve",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 523px; height: 171px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The parasternal short axis view from a transthoracic echocardiogram shows the noncoronary (NCC), right coronary (RCC) and left coronary (LCC) leaflets of the aortic valve. Also seen are the left atrium (LA), right atrium (RA), tricuspid valve (TV), right ventricle (RV) and pulmonic valve (PV).",
