var title_f5_11_5309="Side effects of amiodarone";
var content_f5_11_5309=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F57845&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F57845&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Type and incidence of major side effects associated with amiodarone therapy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"70%\">",
"     </colgroup>",
"     <colgroup width=\"30%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Side effect",
"       </td>",
"       <td class=\"subtitle1\">",
"        Incidence, percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Lung",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Cough, especially with infiltrates on chest radiography and reduced DLCO",
"       </td>",
"       <td>",
"        5 to 15 (&gt;400 mg/day)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1 to 2 (&le;400 mg/day)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Thyroid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Hypothyroidism and hyperthyroidism",
"       </td>",
"       <td>",
"        2 to 24",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3 to 4 (&le;400 mg/day)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Heart",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bradycardia and atrioventricular block",
"       </td>",
"       <td>",
"        3 to 5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Proarrhythmia",
"       </td>",
"       <td>",
"        &lt;1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Liver",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Serum AST or ALT more than two times normal",
"       </td>",
"       <td>",
"        15 to 50",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &nbsp;",
"       </td>",
"       <td>",
"        1 to 2 (&le;400 mg/day)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hepatitis and cirrhosis",
"       </td>",
"       <td>",
"        &lt;3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Eye",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Corneal microdeposits",
"       </td>",
"       <td>",
"        &gt;90",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Halo vision, especially at night",
"       </td>",
"       <td>",
"        &lt;5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Optic neuritis",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Skin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Photosensitivity",
"       </td>",
"       <td>",
"        25 to 75",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Blue discoloration",
"       </td>",
"       <td>",
"        &lt;10",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Gastrointestinal tract",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Nausea, anorexia, and constipation",
"       </td>",
"       <td>",
"        30",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4 to 5 (&le;400 mg/day)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Central nervous system",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Varied manifestations including ataxia, paresthesias, peripheral neuropathy, sleep disturbance, impaired memory, and tremor",
"       </td>",
"       <td>",
"        3 to 30",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4 to 5 (&le;400 mg/day)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Genitourinary tract",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Epididymitis and erectile dysfunction",
"       </td>",
"       <td>",
"        &lt;1",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Goldschlager N, Epstein AE, Naccarelli G, et al. Practical guidelines for clinicians who treat patients with amiodarone. Practice Guidelines Subcommittee, North American Society of Pacing and Electrophysiology. Arch Intern Med 2000; 160:1741; Vorperian VR, Havighurst TC, Miller S, et al. Adverse effects of low dose amiodarone: A meta-analysis. J Am Coll Cardiol 1997; 30:791; and Harjai KJ, Licata AA. Effects of amiodarone on thyroid function. Ann Intern Med 1997; 126:63.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f5_11_5309=[""].join("\n");
