var title_f5_11_5310="Abx for meningitis based on Gram stain";
var content_f5_11_5310=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F75922%7EID%2F60707&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F75922%7EID%2F60707&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for antimicrobial therapy of bacterial meningitis in adults with presumptive pathogen identification by positive Gram stain*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Microorganism",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended therapy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Alternative therapies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <em>",
"         Streptococcus pneumoniae",
"        </em>",
"       </td>",
"       <td>",
"        Vancomycin plus a third-generation cephalosporin&bull;&Delta;",
"       </td>",
"       <td>",
"        Fluoroquinolone&loz;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <em>",
"         Neisseria meningitidis",
"        </em>",
"       </td>",
"       <td>",
"        Third-generation cephalosporin&bull;",
"       </td>",
"       <td>",
"        Chloramphenicol, fluoroquinolone, aztreonam",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <em>",
"         Listeria monocytogenes",
"        </em>",
"       </td>",
"       <td>",
"        Ampicillin&sect; or penicillin G&sect;",
"       </td>",
"       <td>",
"        Trimethoprim-sulfamethoxazole",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <em>",
"         Haemophilus influenzae",
"        </em>",
"       </td>",
"       <td>",
"        Third-generation cephalosporin&bull;",
"       </td>",
"       <td>",
"        Chloramphenicol, cefepime, meropenem, fluoroquinolone",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * For recommended dosages, see the table \"Recommended intravenous dosages of antimicrobial therapy for adults with bacterial meningitis\".",
"     <br>",
"      &bull; Ceftriaxone or cefotaxime.",
"      <br>",
"       &Delta; Some experts would add rifampin if dexamethasone is also given.",
"       <br>",
"        &loz; Moxifloxacin is recommended given its excellent CSF penetration and in vitro activity against",
"        <em>",
"         Streptococcus pneumoniae",
"        </em>",
"        , although there are no clinical data available. If used, many authorities would combine moxifloxacin with vancomycin or a third-generation cephalosporin (cefotaxime or ceftriaxone).",
"        <br>",
"         &sect; Addition of an aminoglycoside should be considered.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Modified with permission from: Tunkel, AR, Hartman, BJ, Kaplan, SL, et al. Practice guidelines for the management of bacterial meningitis. Clin Infect Dis 2004; 39:1267. Copyright &copy;2004 University of Chicago Press.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.journals.uchicago.edu/\">",
"      file://www.journals.uchicago.edu/",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommended intravenous dosages of antimicrobial therapy for adults with bacterial meningitis who have normal renal and hepatic function",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Antimicrobial agent",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose (adult)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Amikacin",
"       </td>",
"       <td>",
"        5 mg/kg every 8 hours*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ampicillin",
"       </td>",
"       <td>",
"        2 g every 4 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Aztreonam",
"       </td>",
"       <td>",
"        2&nbsp;g every 6 to 8 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cefepime",
"       </td>",
"       <td>",
"        2 g every 8 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cefotaxime",
"       </td>",
"       <td>",
"        2&nbsp;g every 4 to 6 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ceftazidime",
"       </td>",
"       <td>",
"        2 g every 8 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ceftriaxone",
"       </td>",
"       <td>",
"        2 g every 12 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chloramphenicol",
"       </td>",
"       <td>",
"        1 to 1.5 g every 6 hours",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ciprofloxacin",
"       </td>",
"       <td>",
"        400 mg every 8 to 12 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gentamicin",
"       </td>",
"       <td>",
"        1.7&nbsp;mg/kg every 8 hours*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Meropenem",
"       </td>",
"       <td>",
"        2&nbsp;g every 8 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Moxifloxacin",
"       </td>",
"       <td>",
"        400 mg every 24&nbsp;hours",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nafcillin",
"       </td>",
"       <td>",
"        1.5 to 2&nbsp;g every 4 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Oxacillin",
"       </td>",
"       <td>",
"        1.5 to 2 g every 4 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Penicillin G potassium",
"       </td>",
"       <td>",
"        4 million units every 4 hours",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rifampin",
"       </td>",
"       <td>",
"        600 mg every 24 hours",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tobramycin",
"       </td>",
"       <td>",
"        1.7&nbsp;mg/kg every 8 hours*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Trimethoprim-sulfamethoxazole (cotrimoxazole)",
"       </td>",
"       <td>",
"        5 mg/kg every 6 to 12 hours",
"        <sup>",
"         &sect;&yen;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vancomycin",
"       </td>",
"       <td>",
"        15 to 20 mg/kg every 8&nbsp;to 12 hours",
"        <sup>",
"         ",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    MRSA: methicillin-resistant",
"    <em>",
"     Staphylococcus aureus",
"    </em>",
"    <div class=\"footnotes\">",
"     * Dose based on ideal body weight or dosing weight, except in underweight patients. A calculator for ideal body weight and dosing weight is available in UpToDate.&nbsp;Dosage and interval must be individualized to produce a peak serum concentration of 7-9 mg/L and trough &lt;1-2 mg/L for gentamicin or tobramycin and a peak of 25-40 mg/L and trough &lt;4-8 mg/L for amikacin. For additional information, see the topic review on aminoglycosides.",
"     <br>",
"      &bull;&nbsp;The higher dose is recommended for patients with pneumococcal meningitis.",
"      <br>",
"       &Delta;&nbsp;No data on optimal dosage needed in patients with bacterial meningitis.",
"       <br>",
"        &loz;&nbsp;For the treatment of MRSA meningitis, the Infectious Diseases Society of America (IDSA)&nbsp;suggests a rifampin dose of 600 mg orally once daily or 300 to 450 mg twice daily.",
"        <sup>",
"         [1]",
"        </sup>",
"        <br>",
"         &sect;&nbsp;Dosage is based on the trimethoprim component.",
"         <br>",
"          &yen;&nbsp;For the treatment of MRSA meningitis, the IDSA suggests a trimethoprim-sulfamethoxazole dose of 5 mg/kg (based on the trimethoprim component) IV twice or three times daily.",
"          <sup>",
"           [1]",
"           <br/>",
"          </sup>",
"          &Dagger;&nbsp;The vancomycin dose should not exceed 2 g per dose or a total daily dose of 60 mg/kg.&nbsp;Adjust dose to achieve vancomycin serum trough concentrations of 15 to 20 mcg/mL.",
"          <sup>",
"           [1]",
"          </sup>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Modified with permission from: Tunkel AR, Hartman BJ, Kaplan SL, et al. Practice guidelines for the management of bacterial meningitis. Clin Infect Dis 2004; 39:1267. Copyright &copy; 2004 University of Chicago Press.",
"     <br>",
"      <em>",
"       Additional data from:",
"       <br/>",
"      </em>",
"      [1] Liu C, Bayer A, Cosgrove SE, et al. Clinical Practice Guidelines by the Infectious Diseases Society of America for the Treatment of Methicillin-Resistant Staphylococcus Aureus Infections in Adults and Children: Executive Summary. Clin Infect Dis 2011; 52:285.",
"     </br>",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.journals.uchicago.edu/\">",
"      file://www.journals.uchicago.edu/",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
